import React, { useState } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import Login from './pages/login';

function App() {

  return (
    <Router>
      <Routes>
        <Route path="/">
          <Login />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
